function makeSimPlot(actual, sim){
  var lineDiv = document.getElementById('line-chart');
  var data = [];

  var traceA = {
    x: actual.dates,
    y: actual.values,
    type: 'scatter'
  };
  data.push(traceA);

  if(sim.values){
    sim.values.forEach(arr => {
      var traceX = {
        x: sim.dates,
        y: arr,
        type: 'scatter'
      };
      data.push(traceX);
    });
  }
  // var traceB = {
  //   y: [1, 2, 3, 4, 16, 17, 26],
  //   x: [1, 40, 9, 60, 4, 20, 10],
  //   type: 'scatter'
  // };

  var layout = {
    title:'Monte Carlo GDP Simulation'
  };

  Plotly.plot( lineDiv, data, layout );
};

